import Box from '@mui/material/Box';
import Skeleton from '@mui/material/Skeleton';

export default function Modeldetail() {
  return (
    <Box sx={{ width: '300%', height: '100%' }}>
      <Skeleton />
      <Skeleton animation="wave" />
      <Skeleton animation={false} />
    </Box>
  );
}
